(177043, 'C813AC5B-589B-49FC-8062-20686D513833', 'Ok, resending my messages from the end of the day...now stuff comes from an iCloud email: I know you felt vulnerable and I was touched by your honesty. True Courage. I felt vulnerable when talking to you about Julie and the aftermath of my affair. It was a moral failing and cowardly and was terribly hurtful and I lied about it. At the same time it was a tremendous part of my awakening to my situation, so casting it simply in bad/good terms doesn''t map to my experience. I''m still untangling it all...it relates to how I deal with intimacy and connection and love. I don''t fully trust myself in this dimension right now, so opening up about it and sharing is pretty hard. ', 'David', 'Nitzan', '2015-07-24T07:48:34'),
(176964, '571D8684-9456-493B-B327-827C88F8C0E2', 'And I sent this Holy fuck. Just listened to the david brooks piece about his divorce and friends...just hit me.', 'David', 'Nitzan', '2015-07-24T07:49:57'),
(176950, '0DEDF400-5BDE-4964-BFE2-05A6246B92A0', 'Yeah, I''ve been waiting for you to tell me about the brooks piece.  ', 'Nitzan', 'David', '2015-07-24T07:50:32'),
(176996, '984030CB-8097-4317-A8CB-A5F7677326E8', 'What hit you?', 'Nitzan', 'David', '2015-07-24T07:50:50'),
(176884, 'E00F4636-BCBC-414E-BC89-318216890BA1', 'The Massive change...he had this line about 7 out of 10 people who will be your closest social circle friends in a year...will be new. Not that extreme, but the change/expansion in this realm is moving quickly and is pretty great', 'David', 'Nitzan', '2015-07-24T07:54:56'),
(177060, '5197E8CE-1EC6-484F-B4CF-F50B94C4379A', 'Ah. I see. Btw, if you google brooks -- he slept with his assistant. I think that was the precursor to his divorce. ', 'Nitzan', 'David', '2015-07-24T07:58:29'),
(176939, '39A19781-0811-473C-8194-943E26AAC321', 'And we kinda chatted about the friends bit a little. We socialize with people who are in our stages of life. So it totally makes sense that our friends change as our lives change. My friends changed after my divorce too. I got much closer to single people. And none of it is intentional. We just start to click in with people who match what our lives are about. ', 'Nitzan', 'David', '2015-07-24T07:59:59'),
(177018, '03C1D785-6A33-4FF1-B2A1-4BF6997886BE', 'It''s super interesting ', 'Nitzan', 'David', '2015-07-24T08:00:05'),
(177014, 'AC72FC09-8347-4663-9528-F5F7D61FEF9F', 'Not sure why my texts are coming from the cloud. But thanks for checking in. I''m really glad you resent the one on vulnerability. It''s a powerful set of thoughts. ', 'Nitzan', 'David', '2015-07-24T08:00:49'),
(176918, '66E0F931-D2F2-46AF-8AAF-D50E5CFE2C74', 'And I totally empathize with not trusting who you are in love and connection and intimacy. I would counter and say the only way you''ll know is if you have more of it and stay present and aware.  ', 'Nitzan', 'David', '2015-07-24T08:01:46'),
(176977, '3CB534E7-ADE3-4C2E-B960-D2C7362A5426', 'It''s why I enjoy processing this stuff with you.', 'Nitzan', 'David', '2015-07-24T08:02:15'),
(177034, '04F38D91-5D22-4D83-8150-CEA4042A60B1', 'I need a name for my new company. Can you help me think of one? Itâ€™s for students who have dropped out of college and we are going to try to get them to re-enroll and graduate. I was thinking DropUp Education, but people say itâ€™s too negative. ', 'Nitzan', 'David', '2015-07-24T09:49:19'),
(176929, 'A4C584DF-078D-466C-B4CC-29AF4E282DB2', 'Name is important....I''m not crazy about DropUp. No positive emotional feel...I agree with that. Do you have small amount of $ to maybe bring in a naming consultant? They can generate a ton of options based on parameters you discuss. We do naming workshops at frog too (sometimes in conjunction with a naming person). Might be more formal than necessary, but if you get stuck and can''t come up with something worth considering.', 'David', 'Nitzan', '2015-07-24T09:59:48'),
(176982, '912AA6E7-F95F-46AA-ABFD-5F1DABF02C6B', 'Holy moley, now get texts from a gmail account! Let Me know that you get this.', 'David', 'Nitzan', '2015-07-24T10:00:49'),
