(176976, 'E25F13DA-EED9-4E79-9C34-7EAC0A4D1610', 'Not yet. I''ve been working. Hard to do, but will be driving soon. Been busy with work. This Pfizer thing is moving fast. Think I''ll have a better indication whether it is something I will want to do. Both my Pfizer clients want me to...I have to define a bit want I''d want it to be. ', 'David', 'Nitzan', '2015-07-24T11:53:12'),
