(177008, '48AAB578-9217-4523-8A06-610F9160349C', 'I''m mostly done. Miss you. Want higher fidelity communication. This car ride is too weird.', 'David', 'Nitzan', '2015-07-24T12:02:58'),
(176973, '251DFD24-C62B-463E-990D-0A81B901072D', 'Tell me more about either the car ride or the ideas for Pfizer! ', 'Nitzan', 'David', '2015-07-24T12:03:53'),
(176926, 'BF8B917C-F429-45EF-847D-88638A36170F', 'I''m thinking about david brooks.  He brings up this metaphor of us being built from crooked timber, taken from a Kant line: Out of every crooked timberÂ  No straight thing was ever madeÂ   Beautiful and fitting metaphor. It''s the idea that emphasizes our brokenness....that requires humility in the face of our limitations, to confront our weaknesses.  I feel this approach to life very present right now....feel that being confronted with some of my shit to have been such a gift. Still have blind spots, for sure, but much better than just a year ago.  There are specifics here that I''d like to talk to you about... But in person ', 'David', 'Nitzan', '2015-07-24T12:16:51'),
(176927, 'CE379BAA-D3D2-4D18-BB08-C4CB6D719566', 'Crooked timber is a great song name...', 'David', 'Nitzan', '2015-07-24T12:20:42'),
(176875, '068B3E0F-B817-40BD-831E-7E55A4C91F13', 'Can I assign you some hw for this weekend? Can you read Paul Tough''s ''what if the secret to success is failure?'' It was a New York Times feature story a few years ago. I read it, sobbed and sobbed, and then made every board member and staff member read it. I think it wil resonate deeply for you and also add to some of the ideas that Brooks posits about brokenness. ', 'Nitzan', 'David', '2015-07-24T12:46:21'),
(176945, '252E59AE-F226-468F-88D5-FB6A61B1FE75', 'Did the Brooks interview feel powerful to you? ', 'Nitzan', 'David', '2015-07-24T12:46:33'),
(176998, '10133BFF-CD07-40BC-B85C-1650A7FE5696', 'Also, have you seen berne brown''s ted talk on shame? If no, watch it. ', 'Nitzan', 'David', '2015-07-24T13:00:20'),
(176903, '7EC639AF-1914-4C42-BAB6-0AC3C43673B2', 'Yes, although I''m not finished. It has been difficult to listen to in pieces. I''ll read the paul tough article. But I''m going to start giving you listening homework! ', 'David', 'Nitzan', '2015-07-24T13:01:03'),
