(177127, '61AF103D-ED87-4C3A-9C65-880FE39C3D03', 'Like the reframing. Soul nourishment.', 'Nitzan', 'David', '2015-07-24T14:27:17'),
(176921, '6F579397-5021-4554-A59A-E7BFFDA3F5AD', 'And same on my '' hw assignments.'' I think they are about themes you are really processing deeply. And my hope is it will add to some of your already very thoughtful reflections. ', 'Nitzan', 'David', '2015-07-24T14:29:44'),
(177009, '3562CC6A-9C6F-405B-BE69-C3709F6CF464', 'So less about education and more about ideas. ', 'Nitzan', 'David', '2015-07-24T14:30:11'),
(177085, 'F5249E49-30DA-48A4-AC65-0D84CF126DB5', 'I want you to know that I know being vulnerable is really hard and is very risky for the heart. I''m so touched by you opening up to me. And hope we find ways to keep building safe spaces so that we do that more. That is soul enhancement too. ', 'Nitzan', 'David', '2015-07-24T14:31:39'),
