(177031, '4C1DD19F-0104-4FCA-AA4C-DD2387793A4A', 'Just kinda over the edge dealing with lawyer bullshit. I feel positively abused. Her business tanked us...partially through lying to me, and friends. Had to work my ass off for the past two years to dig out of a hole with 0 support. Still no job. I tried working for a fair solution in mediation, and now just more utter nonsense.  Did it  because I wanted her to follow her dream and I saw it made her happy. I was an idiot and I feel totally taken advantage of. Too trusting...the downside.  Rant over. I''ve been keeping quiet in this car. It is hard.', 'David', 'Nitzan', '2015-07-24T16:55:28'),
